import React from 'react';
import './Itemcard.css';
import CheckCircleOutlineIcon from '@mui/icons-material/CheckCircleOutline';
const Itemcard=(props)=>{
    return (
        
<div className="col-11 col-md-6 col-lg-3 mx-0 mb-4" style={{width:'300px'}}>
<div class="card-header">
    Featured
  </div>
            <div className="card p-0 overflow-hidden h-100 shadow">

  <div className="card-body1" ><table><tr>
    <h5 className="card-title" style={{align:"left"}}>{props.title}</h5></tr>
    <tr><p className="card-text" style={{align:"left"}}>{props.desc1}<CheckCircleOutlineIcon className="CheckIcon"/></p></tr>
    <tr><p className="card-text" style={{align:"left"}}>{props.desc2}<CheckCircleOutlineIcon className="CheckIcon"/></p></tr>
    <tr><p className="card-text" style={{align:"left"}}>{props.desc3}<CheckCircleOutlineIcon className="CheckIcon"/></p></tr>
    <tr><p className="card-text" style={{align:"left"}}>{props.desc4}<CheckCircleOutlineIcon className="CheckIcon"/></p>
     </tr> </table></div>
   {/*
    <button className="btn btn-primary">{props.button}</button>*/}
    <div className="card-footer text-muted" align="right">
    2 days ago
  </div>

</div>
        </div>
        

    );
};
export default Itemcard;
